description:
Chính chủ cần bán gấp mảnh đất 100m2 đường vào Làng Nôi, Gia Lập, Gia Viễn, Ninh Bình;
Mặt tiền 5m, dài 20m; Đường rộng 13m; Hạ tầng điện nước hoàn chỉnh, xây nhà là ở được ngay. Đất nằm trên trục đường rộng 13-15m, vào thánh đường giáo xứ Lãng Vân và khu du lịch Đầm Long.
NƠI YÊN BÌNH ĐẤT LÀNH CHIM ĐẬU; Nơi vượng khí sinh tài lộc.Nơi bốn mùa bình an hạnh phúc.
